query:
DELETE FROM events WHERE name = 'Breakfast Meeting' AND id NOT IN (
  SELECT DISTINCT e.id 
  FROM events e 
  INNER JOIN participants p ON e.id = p.eventId 
  WHERE e.name = 'Breakfast Meeting'
);

